import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Sudoku Solver</h1>
      <h2><a href='readme.md'>Click here</a></h2>
      <table align='center'>
        <tbody>

          {
            [0, 1, 2, 3, 4, 5, 6, 7, 8].map((row, rIndex) => {
              return <tr key={rIndex}>

                {[0, 1, 2, 3, 4, 5, 6, 7, 8].map((col, cIndex) => {
                  return <td key={rIndex + cIndex}>
                    <input className='inputsection' />
                  </td>
                })}
              </tr>
            })
          }
        </tbody>
      </table>
      <footer>
        these solver is a project made for educational purpose only, <a href ="clomen.web.app">know more about the developer</a>  
      </footer>
    </div>
  );
}

export default App;
